import {Link} from 'react-router-dom';
import './login.css'
function Forget(){
    return(
    <div className="login">
        <h1>Recovery</h1>
        <input type="textbox" placeholder="Username" />
        <input type="email" placeholder="Email Address" />
        <Link to ='/'><button className="sumbit">Continue</button></Link>
    </div>
    )
}
export default Forget;
